import React, { Component } from "react";
import "./main.css";
import fire from "./database";
class UserCvs extends Component {
  componentDidMount() {
    // fire
    // .database()
    // .ref("users")
    // .on("value", snapshot => {
    //   const users = snapshot.val();
    //   console.log(users);}

    fire
      .database()
      .ref("users")
      .on("value", snapshot => {
        snapshot.val();
      });
  }

  render() {
    return (
      <div>
        <h1>User Shits</h1>
      </div>
    );
  }
}

export default UserCvs;
